import axios from 'axios';

function getUserData() {
    axios.get('http://127.0.0.1:8000/api/user_view/')
        .then(response => {
            response.data.forEach(element => {console.log(element)});
        })
        .catch(error => {
            console.log(error);
        });
}

export default getUserData
